tables.table_schema:
CREATE TABLE IrisScanData (
    id INT PRIMARY KEY,
    scan_data BYTEA,
    scan_time TIMESTAMP
);

CREATE TABLE PerformanceMetrics (
    metric_id SERIAL PRIMARY KEY,
    retrieval_time FLOAT,
    query_performance VARCHAR
);

CREATE TABLE Monitoring (
    monitor_id SERIAL PRIMARY KEY,
    monitor_type VARCHAR,
    monitor_date DATE
);

CREATE TABLE iris_scan_data (
  iris_id UUID,
  scan_data BYTEA,
  verification_status BOOLEAN,
  scan_timestamp TIMESTAMP
);

CREATE TABLE performance_metrics (
  metric_id SERIAL,
  query_time DECIMAL,
  execution_plan JSONB,
  query_cost DECIMAL
);

CREATE TABLE user_activity_logs (
  log_id SERIAL,
  user_id UUID,
  action VARCHAR(255),
  log_timestamp TIMESTAMP
);

CREATE TABLE IF NOT EXISTS PerformanceMetrics (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    query_time FLOAT,
    response_time FLOAT
);

CREATE TABLE IF NOT EXISTS QueryHistory (
    id INT PRIMARY KEY,
    user_id INT,
    query TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE IF NOT EXISTS users (
    id UUID PRIMARY KEY,
    username STRING,
    email STRING,
    created_at TIMESTAMP
);

CREATE TABLE IF NOT EXISTS devices (
    id UUID PRIMARY KEY,
    device_name STRING,
    user_id UUID,
    created_at TIMESTAMP
);

CREATE TABLE IF NOT EXISTS iris_scans (
    id UUID PRIMARY KEY,
    scan_data BYTES,
    device_id UUID,
    created_at TIMESTAMP
);

CREATE TABLE IF NOT EXISTS performance_logs (
    id UUID PRIMARY KEY,
    device_id UUID,
    processing_time INT,
    created_at TIMESTAMP
);

CREATE TABLE IF NOT EXISTS notifications (
    id UUID PRIMARY KEY,
    message STRING,
    user_id UUID,
    created_at TIMESTAMP
);
